import React from 'react'
import LoadStreamers from '../components/LoadStreamers'

function Cuerpostreams(props) {
    return(
        <div className="col-12">
                          {
                              props.info.map((info) => {
                                  return(
                                  <LoadStreamers infoSend={info.nombre} infoId={info.id} />
                                  )
                              })
                          }
                     </div>
    )
}
export default Cuerpostreams
